create Database graphql_poc01
\c graphql_poc01

create table Person (
	uuid INT,
	valid_from DATE,
	valid_to DATE,
	fullName VARCHAR(50),
	firstName VARCHAR(50),
	lastName VARCHAR(50),
	title VARCHAR(50),
	salutation VARCHAR(50),
	IsCustomer VARCHAR(50),
	gender VARCHAR(50),
	placeOfBirth VARCHAR(50),
	countryOfBirth VARCHAR(50),
	nationality VARCHAR(50),
	martialStatus VARCHAR(50),
	birthDate DATE,
	deathDate DATE,
	formattedName VARCHAR(50),
	location VARCHAR(50),
	satus VARCHAR(50),
	club VARCHAR(50)
);



create table Address (
	uuid INT,
	streetName VARCHAR(50),
	streetNumber VARCHAR(50),
	streetNumberSuffix VARCHAR(50),
	postcode VARCHAR(50),
	city VARCHAR(50),
	statOrProvince VARCHAR(50),
	Country VARCHAR(50)
);



